window.bookSummaryJSON = "<p>Dean, a young woman that lost her partner in a car accident, takes a job at a hotel during her time of mourning, leaving her old life behind. When a new woman, Kayla, gets hired to assist her in running the hotel, Dean gets defensive, and the two battle it out until the doors of the past are reopened.&nbsp;</p> <p>In the meantime, Dean is called back to her side job as a private investigator and has to break the secrets behind a drug-hustling prostitution ring without blowing her cover. Dean and Kayla begin to grow close, and as everything plays out, Dean has to decide what is important in her life and if she will ever be able to let another person in without blowing her cover.</p>"; 
